import React from 'react';
import { Link } from 'react-router-dom';

const Rentals = () => {
  const rentals = [
    { id: 1, movie: 'Inception', customer: 'John Doe', startDate: '2024-06-01', dueDate: '2024-06-08', returned: '2024-06-07' },
    { id: 2, movie: 'The Matrix', customer: 'Jane Smith', startDate: '2024-06-05', dueDate: '2024-06-12', returned: null },
  ];

  return (
    <div style={styles.container}>
      <h1>Rentals List</h1>
      <button style={styles.createButton}>Create +</button>
      <table style={styles.table}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Movie</th>
            <th>Customer</th>
            <th>Start Date</th>
            <th>Due Date</th>
            <th>Returned</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {rentals.map((rental) => (
            <tr key={rental.id}>
              <td>{rental.id}</td>
              <td>{rental.movie}</td>
              <td>{rental.customer}</td>
              <td>{rental.startDate}</td>
              <td>{rental.dueDate}</td>
              <td>{rental.returned ? rental.returned : 'Not Returned'}</td>
              <td>
                <button style={styles.actionButton}>Read</button>
                <button style={styles.actionButton}>Edit</button>
                <button style={styles.deleteButton}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  createButton: {
    backgroundColor: 'green',
    color: 'white',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginBottom: '20px',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
  tableHeader: {
    backgroundColor: '#f2f2f2',
  },
  tableData: {
    border: '1px solid #ddd',
    padding: '8px',
  },
  actionButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '5px 10px',
    marginRight: '5px',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
  },
  deleteButton: {
    backgroundColor: '#dc3545',
    color: 'white',
    padding: '5px 10px',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
  },
};

export default Rentals;
